import React from 'react'
import Slider from 'react-slick'
import "./style.css";

class Carousel extends React.Component {
  render () {
    var settings = {
      dots: true
    }
    return (
      <div className='images'>
        <Slider {...settings}>
          <div>
            <img src='https://upload.wikimedia.org/wikipedia/en/thumb/a/a3/Catan-2015-boxart.jpg/250px-Catan-2015-boxart.jpg'
              alt='Catan'
            //  style={{ margin: 'auto', padding: '1em', borderRadius: '200px' }}
            />
          </div>
          <div>
            <img
              src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSDnNvJiRs2vPjPEwkkz1IqqwHOHivkq-av8UKRkDHQbhvjtmC_RA/g/400/200'
              alt='Monopoly'
            //  style={{ margin: 'auto', padding: '1em', borderRadius: '200px' }}
            />
          </div>
          <div>
            <img
              src='https://pbs.twimg.com/media/D9iZq-yWkAA0tT0.jpg/g/400/200'
              alt='Photosynthesis'
            //  style={{ margin: 'auto', padding: '1em', borderRadius: '200px' }}
            />
          </div>
          <div>
            <img
              src='https://i.ebayimg.com/images/g/A88AAOSwIk9ag6rH/s-l300.jpg/g/400/200'
              alt='D and D'
            //  style={{ size: '300px', margin: 'auto', padding: '1em', borderRadius: '200px' }}
            />
          </div>
        </Slider>
      </div>
    )
  }
}

export default Carousel
